CREATE SCHEMA IF NOT EXISTS autospotr_core;

SET timezone = 'UTC';
-- Testing Schema
-- used for automated tests

DROP TABLE IF EXISTS autospotr_core.test_object CASCADE;
CREATE TABLE IF NOT EXISTS autospotr_core.test_object (
  id serial primary key,
  test_string varchar(200),
  test_object jsonb,
  test_int int,
  updated_on timestamptz,
  created_on timestamptz
);

-- Authorization Schema
DROP TABLE IF EXISTS autospotr_core.users CASCADE;
CREATE TABLE IF NOT EXISTS autospotr_core.users (
  id serial primary key,
  first_name varchar(20),
  last_name varchar(20),
  username varchar(20) unique,
  picture varchar(250),
  locale varchar(6),
  email varchar(50) unique,
  email_verified boolean,
  updated_on timestamptz,
  created_on timestamptz,
  sub varchar(50) unique
);

-- Auto Schema
DROP TABLE IF EXISTS autospotr_core.auto_trims CASCADE;
DROP TABLE IF EXISTS autospotr_core.auto_models CASCADE;
DROP TABLE IF EXISTS autospotr_core.auto_makes CASCADE;
DROP TABLE IF EXISTS autospotr_core.clips CASCADE;

CREATE TABLE IF NOT EXISTS autospotr_core.auto_makes (
  id serial primary key,
  name varchar(50) unique,
  logo_image varchar(250),
  founded_year smallint,
  updated_on timestamptz,
  created_on timestamptz
);

CREATE TABLE IF NOT EXISTS autospotr_core.auto_models (
  id serial primary key,
  name varchar(100),
  make serial references autospotr_core.auto_makes(id),
  production_start_year smallint,
  production_end_year smallint,
  updated_on timestamptz,
  created_on timestamptz,
  UNIQUE (name, make)
);

CREATE TABLE IF NOT EXISTS autospotr_core.auto_trims (
  id serial primary key,
  name varchar(100),
  model serial references autospotr_core.auto_models(id),
  production_start_year smallint,
  production_end_year smallint,
  updated_on timestamptz,
  created_on timestamptz,
  UNIQUE (name, model)
);

CREATE VIEW autospotr_core.auto_search AS
  SELECT auto_trims.id AS id, 
    auto_trims.id AS trim_id, 
    auto_models.id AS model_id,
    auto_makes.id AS make_id,
    auto_makes.logo_image AS make_logo_image,
    auto_trims.name AS trim_name,
    auto_trims.production_start_year AS trim_production_start_year,
    auto_trims.production_end_year AS trim_production_end_year,
    auto_models.name AS model_name,
    auto_models.production_start_year AS model_production_start_year,
    auto_models.production_end_year AS model_production_end_year,
    auto_makes.name AS make_name

  FROM autospotr_core.auto_trims
  JOIN autospotr_core.auto_models ON auto_trims.model = auto_models.id
  JOIN autospotr_core.auto_makes ON auto_models.make = auto_makes.id;

-- Media schema
CREATE TABLE IF NOT EXISTS autospotr_core.clips (
  id serial primary key,
  source varchar(250),
  trim serial references autospotr_core.auto_trims(id),
  UNIQUE (source, trim)
);

-- Daily game mode schema
DROP VIEW IF EXISTS autospotr_core.daily_answer_search;
DROP TABLE IF EXISTS autospotr_core.daily_answer_submissions;
DROP TABLE IF EXISTS autospotr_core.daily_prompt_submissions;
DROP TABLE IF EXISTS autospotr_core.daily_prompts;

CREATE TABLE IF NOT EXISTS autospotr_core.daily_prompts (
  id serial primary key,
  prompt_date date,
  prompt_round smallint,
  time_limit_ms int,
  clip serial references autospotr_core.clips(id),
  questions jsonb,
  updated_on timestamptz,
  created_on timestamptz,
  UNIQUE (prompt_date, prompt_round)
);

CREATE TABLE IF NOT EXISTS autospotr_core.daily_prompt_submissions (
  id serial primary key,
  user_id serial references autospotr_core.users(id),
  prompt serial references autospotr_core.daily_prompts(id),
  updated_on timestamptz,
  created_on timestamptz,
  UNIQUE (user_id, prompt)
);

CREATE TABLE IF NOT EXISTS autospotr_core.daily_answer_submissions (
  id serial primary key,
  user_id serial references autospotr_core.users(id),
  submission serial references autospotr_core.daily_prompt_submissions(id),
  question_number smallint,
  answer jsonb,
  correct boolean,
  updated_on timestamptz,
  created_on timestamptz
);

CREATE VIEW autospotr_core.daily_answer_search AS
  SELECT 
    clips.id as clip_id,
    clips.source as clip_source,
    clips.trim as clip_trim_id,
    daily_prompts.id as prompt_id,
    daily_prompts.prompt_date,
    daily_prompts.questions,
    daily_prompts.time_limit_ms,
    daily_prompt_submissions.id as submission_id,
    daily_prompt_submissions.created_on as submission_created_on,
    daily_prompt_submissions.user_id as user_id,
    daily_answer_submissions.question_number as question_number,
    daily_answer_submissions.id,
    daily_answer_submissions.answer,
    daily_answer_submissions.correct,
    daily_answer_submissions.created_on,
    daily_answer_submissions.created_on - daily_prompt_submissions.created_on as prompt_elapsed_time,
    daily_answer_submissions.created_on - LAG(daily_answer_submissions.created_on) OVER (PARTITION BY daily_prompt_submissions.id ORDER BY daily_answer_submissions.question_number) as question_elapsed_time

  FROM autospotr_core.clips
  LEFT JOIN autospotr_core.daily_prompts on clips.id = daily_prompts.clip
  LEFT JOIN autospotr_core.daily_prompt_submissions on daily_prompts.id = daily_prompt_submissions.prompt
  LEFT JOIN autospotr_core.daily_answer_submissions on daily_prompt_submissions.id = daily_answer_submissions.submission;


CREATE VIEW autospotr_core.daily_leaderboard AS
  WITH correct_answers AS (
      SELECT 
        daily_prompt_submissions.id as submission_id,
        COUNT(*) as correct_count
      FROM autospotr_core.daily_answer_submissions
      JOIN autospotr_core.daily_prompt_submissions ON daily_answer_submissions.submission = daily_prompt_submissions.id
      WHERE correct = true
      GROUP BY daily_prompt_submissions.id
    )
    SELECT 
      clips.id as clip_id,
      clips.source as clip_source,
      clips.trim as clip_trim_id,
      daily_prompts.id as prompt_id,
      daily_prompts.prompt_date,
      daily_prompts.time_limit_ms,
      daily_prompts.questions->'values'->daily_answer_submissions.question_number->'question' as question,
      daily_prompt_submissions.id as submission_id,
      daily_prompt_submissions.created_on as submission_created_on,
      daily_prompt_submissions.user_id as user_id,
      daily_answer_submissions.question_number as question_number,
      daily_answer_submissions.id,
      daily_answer_submissions.correct,
      daily_answer_submissions.created_on,
      daily_answer_submissions.created_on - daily_prompt_submissions.created_on as prompt_elapsed_time,
      daily_answer_submissions.created_on - LAG(daily_answer_submissions.created_on) OVER (PARTITION BY daily_prompt_submissions.id ORDER BY daily_answer_submissions.question_number) as question_elapsed_time
    FROM autospotr_core.clips
    LEFT JOIN autospotr_core.daily_prompts on clips.id = daily_prompts.clip
    LEFT JOIN autospotr_core.daily_prompt_submissions on daily_prompts.id = daily_prompt_submissions.prompt
    LEFT JOIN autospotr_core.daily_answer_submissions on daily_prompt_submissions.id = daily_answer_submissions.submission
    JOIN correct_answers on daily_prompt_submissions.id = correct_answers.submission_id
    WHERE correct_answers.correct_count >= 3;

